import React from 'react';
import CodeEditor from './CodeEditor.js';
import ErrorsPanel from './ErrorsPanel.js';
import ConsolePanel from './ConsolePanel.js';

function App() {
  return (
    <div className="app-container">
      <CodeEditor />
      <div className="side-panels">
        <ErrorsPanel />
        <ConsolePanel />
      </div>
    </div>
  );
}

export default App;
